import time
import logging

# Configure basic logging for file output compatibility (standard print statements work here too)
# We will use logging.info, which acts like print() but is cleaner for long-running processes.
logging.basicConfig(level=logging.INFO, format='%(asctime)s - %(levelname)s - %(message)s')

def decode_caesar_cipher(encoded_string, shift):
    """
    Decodes a string using a Caesar cipher by subtracting the shift value 
    from the ASCII (ordinal) value of each character.
    """
    decoded_chars = []
    
    start_time = time.time()
    total_length = len(encoded_string)
    
    logging.info(f"Decoding {total_length} characters with a shift of -{shift}...")
    
    # Track progress and execution
    progress_interval = max(total_length // 10, 1) # Update every 10%
    
    for i, char in enumerate(encoded_string):
        # Subtract the shift from the ASCII value and convert back to a character
        try:
            decoded_char = chr(ord(char) - shift)
            decoded_chars.append(decoded_char)
        except ValueError:
            # Handle non-printable characters or bad shifts
            decoded_chars.append('') 

        # Progress update
        if i % progress_interval == 0 and i > 0:
            progress = (i / total_length) * 100
            # Logging the progress to the output file
            logging.info(f"Progress: {progress:.1f}% complete...")

    end_time = time.time()
    elapsed = end_time - start_time
    logging.info(f"Decoding finished in {elapsed:.4f} seconds.")
    
    return "".join(decoded_chars)

